import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: flex-start;
  padding: 17px 0 47px 0;
  width: 100%;
  height: 396px;
  background: linear-gradient(
    270deg,
    #efac86 -1.13%,
    #f1b758 101.86%,
    #f1b758 101.87%
  );
`;
